descr.p:
Three byte, simple checksum (see Volume 2: "CheckSum Calculation" of FIX Specificationfor description).
ALWAYS LAST FIELD IN MESSAGE; i.e. serves, with the trailing <SOH>, as the
end-of-message delimiter. Always defined as three characters. (Always unencrypted)

block.comment:
Used to specify the parties for the trades to be returned (clearing firm, execution
broker, trader id, etc.): ExecutingBroker; ClearingFirm; ContraBroker; ContraClearingFirm;
SettlementLocation - depository, CSD, or other settlement party; ExecutingTrader;
InitiatingTrader; OrderOriginator.
